#include<iostream>
using namespace std;
int main(){
    int a=57;
    int b=12;
    cout<<"Addition of a and b = "<<a+b<<"\n";
    cout<<"Subtractio of a and b = "<<a-b<<"\n";
    cout<<"Multiplication of a and b = "<<a*b<<"\n";
    cout<<"Division of a and b = "<<a/b<<"\n";
    cout<<"Modulus of a and b = "<<a%b<<"\n";
    return 0;
}

